import React from "react";
import {useParams} from "react-router-dom";
import Breadcrumbs from "../../components/Breadcrumbs";

export default function TeamDetail() {
    const { id } = useParams();

    return (
        <div>
            <Breadcrumbs/>
            <h1>Team</h1>
            <p>Team ID: {id}</p>
        </div>
    );
}
